I wanted to raise an issue to find out if it is a bug or if I'm using the lib wrong.

The expectation is to have the same output from both the `_.map` and `__.map` functions.

``` js
const __ = fp(_.runInContext());
const input = {foo: 42};
const fn = (v,k) => [v,k];

_.map(input, fn)
// [
//   [
//     42,
//     "foo"
//   ]
// ]
__.map(fn, input)
// [
//   [
//     42,
//     null
//   ]
// ]
```

Is there a reason [`Math.trunc()`](https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Math/trunc) is not available as `_.trunc` under Math?

