I'm using react-bootstrap that depends on lodash-compat. Unfortunately the version v3.10.2 contains an old implementation of `isHostObject` that throws an exception when is being defined, not the first time is used. 

FROM https://github.com/lodash-archive/lodash-compat/blob/master/lodash.js

```
    /**
     * Checks if `value` is a host object in IE < 9.
     *
     * @private
     * @param {*} value The value to check.
     * @returns {boolean} Returns `true` if `value` is a host object, else `false`.
     */
    var isHostObject = (function() {
      try {
        Object({ 'toString': 0 } + ''); <-------- ANNOYING EXCEPTION HERE 
      } catch(e) {
        return function() { return false; };
      }
      return function(value) {
        // IE < 9 presents many host objects as `Object` objects that can coerce
        // to strings despite having improperly defined `toString` methods.
        return typeof value.toString != 'function' && typeof (value + '') == 'string';
      };
    }());
```

This means that if you have `Pause On Caught Exception` in Chrome you'll get stopped in the wrong place every single time that you refresh the page. It's quite annoying.   

Looks like the new version has solved this problem. FROM [lodash.core](https://github.com/lodash/lodash/blob/bc8efe4cac92dc2dee7dfd855fe713cb54efc929/dist/lodash.core.js)

``` /**
   * Checks if `value` is a host object in IE < 9.
   *
   * @private
   * @param {*} value The value to check.
   * @returns {boolean} Returns `true` if `value` is a host object, else `false`.
   */
  function isHostObject(value) {
    // Many host objects are `Object` objects that can coerce to strings
    // despite having improperly defined `toString` methods.
    var result = false;
    if (value != null && typeof value.toString != 'function') {
      try {
        result = !!(value + '');
      } catch (e) {}
    }
    return result;
  }
```

I know lodash-compat is discontinued but, is there any chance that the new implementation is ported back to v3.10.2?. React-bootstrap can not update to v4 because they need IE8 compatibility https://github.com/react-bootstrap/react-bootstrap/issues/1635#issuecomment-176689227

Thanks in advance.

This PR adds scripts to generate docs for lodash/fp rather than lodash. This is made in the hope of having them available on the [documentation page](https://lodash.com/docs) of the website.

The parameters are reordered:
`_.set(object, path, value)` --> `_.set(path, value, object)`
And also the code samples

``` js
var object = { 'a': 1, 'b': '2', 'c': 3 };
_.pickBy(object, _.isNumber);
-->
_.pickBy(_.isNumber, object);
// => { 'a': 1, 'c': 3 }
```

even though some examples mutate values, making the code sample not right

``` js
_.set('x[0].y.z', 5, object);
console.log(object.x[0].y.z); // --> object is not mutated, so the example is not 100% correct
// => 5
```

Also, some examples (for `transform` and `reduce`) did not specify their optional third argument, which is not optional anymore in `lodash/fp`. I added the third argument so as not to cause problems with this, I hope that's okay.

I tried to do this without forking `docdown`, and it works, except for one tiny little thing: `docdown` would need change [one line](https://github.com/jdalton/docdown/blob/master/lib/entry.js#L51) from
`this.getExample = _.memoize(getExample)` to `this.getExample = _.memoize(this.getExample)`, which would allow overriding the "default" behavior.

Currently, the generated document is written at the same location as the regular doc and would need to be changed if the website is updated to present both. And I haven't gone through all the code samples and functions to verify that everything was reordered correctly.

Tell me what you think!

