For instance, in 3.x I want an object that omits all properties that are prefixed with _, in 3.x this was:

```
_.pick(foo, function (value, key) {
                    return key.charAt(0) !== "_";
});
```

in 4.0, key is no longer passed with pickBy...

```
_.pickBy(foo, function (value, key) {
                    return key.charAt(0) !== "_";
});

//foo always equals {};
```

